import React from "react";
import {  Typewriter} from "react";
// import "./App.js";
import logo from "../src/images/IMG_20210329_205312_237.jpg";
const Home = () => {
    
  return (
    <>
      <header>
        <div className="container">


            <div className="logo flex justify-center align-items">
                <img src={logo}/>
            </div>
            <div className="text flex justify-center align-items">
                <strong>Hey User! &nbsp<span className="type">
                    <Typewriter
                    options={{
                        autoStart:true,
                        loop:true,
                        delay:40,
                        strings:[
                        "i m a robot",
                        "m a sahil"
                        ],
                    }}/>
                </span></strong>
                <p>Here you get all awesome features to implement in you websites.So don't confuse where to start and when to start.</p>
                <p> we provide you the best youtube free channels to learn full course of Web development, Python ,java and many much more...</p>
                <div className="btn-main">
                    <a href="#">
                        <button className="btn-bg4 btn-clr1">Watch videos</button>
                    </a>
                    <a href="#">
                        <button className="btn-bg4 btn-clr2">Subscribe Our Channel</button>
                    </a>
                    <a href="">
                        <button className="btn-bg4 btn-clr3">Browse Blogs</button>
                    </a>
                </div>

            </div>

        </div>
    </header>
   
    </>
  );
};
export default Home;
